// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract VertCoin is ERC20, Ownable {
    struct Loan {
        address borrower;
        uint256 amount;
        uint256 timestamp;
        uint256 duration;
        uint256 interestRate;
        bool isClosed;
    }

    mapping(address => uint256) public lentAmount;
    Loan[] public loans;
    uint256 public maxLoanDuration = 30 days;
    uint256 public maxInterestRate = 500; // 5%
    uint256 public minLoanAmount = 10 * 10 ** decimals(); // 10 VTC
    uint256 public minLendAmount = 10 * 10 ** decimals(); // 10 VTC

    constructor() ERC20("VertCoin", "VTC") {
        _mint(msg.sender, 1000000000 * 10 ** decimals());
    }

    function lend(address _borrower, uint256 _amount) external {
        require(
            _amount >= minLendAmount,
            "Amount is below minimum lend amount"
        );
        require(balanceOf(msg.sender) >= _amount, "Insufficient balance");

        // Transfer VTC to borrower
        _transfer(msg.sender, _borrower, _amount);

        // Update lentAmount
        lentAmount[_borrower] += _amount;
    }

    function createLoan(
        uint256 _amount,
        uint256 _duration,
        uint256 _interestRate
    ) external {
        require(
            _amount >= minLoanAmount,
            "Amount is below minimum loan amount"
        );
        require(
            _duration <= maxLoanDuration,
            "Duration is above maximum loan duration"
        );
        require(
            _interestRate <= maxInterestRate,
            "Interest rate is above maximum interest rate"
        );
        require(balanceOf(msg.sender) >= _amount, "Insufficient balance");

        // Transfer VTC to loan contract
        _transfer(msg.sender, address(this), _amount);

        // Create loan
        loans.push(
            Loan({
                borrower: msg.sender,
                amount: _amount,
                timestamp: block.timestamp,
                duration: _duration,
                interestRate: _interestRate,
                isClosed: false
            })
        );
    }

    function repayLoan(uint256 _loanId) external {
        Loan storage loan = loans[_loanId];
        require(!loan.isClosed, "Loan is already closed");
        require(msg.sender == loan.borrower, "Only borrower can repay loan");

        // Calculate amount to be repaid
        uint256 duration = block.timestamp - loan.timestamp;
        uint256 interest = (loan.amount * duration * loan.interestRate) /
            (365 days) /
            100;
        uint256 amountToRepay = loan.amount + interest;

        // Transfer VTC from borrower to loan contract
        require(balanceOf(msg.sender) >= amountToRepay, "Insufficient balance");
        _transfer(msg.sender, address(this), amountToRepay);

        // Transfer VTC from loan contract to lender
        _transfer(address(this), msg.sender, loan.amount);

        // Close loan
        loan.isClosed = true;

        // Update lentAmount
        lentAmount[msg.sender] = SafeMath.sub(
            lentAmount[msg.sender],
            loan.amount
        );
    }

    function withdraw() external onlyOwner {
        uint256 balance = balanceOf(address(this));
        require(balance > 0, "Contract has no tokens to withdraw");
        _transfer(address(this), msg.sender, balance);
    }
}
